function getValue(n){return $(n).val()}function setValue(n,t){$(n).val(t)}function setHtml(n,t){$(n).html(t)}function openStaticModal(n){$(n).modal({backdrop:"static"})}function closeModal(n){$(n).modal("hide")}function disableElement(n){$(n).prop("disabled",!0)}function enableElement(n){$(n).prop("disabled",!1)}